import React from 'react';
import { Container } from 'react-bootstrap';

const Reviews = () => {
    return (
        <div>
            <Container>
            <div>
            <h1 className=" display-5">Featured Products</h1>
            <p className=" mb-5">Recently added our store</p>
            </div>
            </Container>
        </div>
    );
};

export default Reviews;
